import React, { Component } from 'react';
import logo from '../logo.svg';
import './App.css';
import Title from "./Title/title";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="container">
            <div className="row"></div>
        </div>
      </div>
    );
  }
}

export default App;
